/**
 * Get the item with the given key
 * @param {!String|Number} key  The key or index of the item
 * @return {?Object} return the model object for that item, if any.
 */
eYo.Model.statistics.getItem = function (key) {
  if (!goog.isNumber(key)) {
    key = eYo.Model.statistics.data.by_name[key]
  }
  if (goog.isNumber(key)) {
    return eYo.Model.statistics.data.items[key]
  }
}

/**
 * Get the type of the given item.
 * @param {!Object} item.
 * @return {?String} return the type.
 */
eYo.Model.statistics.getType = function (item) {
  return item && item.type && eYo.Model.statistics.data.types[item.type]
}

/**
 * Get the indices of the items for the given category
 * @param {!String} key  The name of the category
 * @return {!Array} the list of item indices with the given category (possibly void).
 */
eYo.Model.statistics.getItemsInCategory = function (category, type) {
  var ra = eYo.Model.statistics.data.by_category[category] || []
  if (goog.isString(type)) {
    type = eYo.Model.statistics.data.type.indexOf(type)
  }
  if (goog.isNumber(type) && type >= 0) {
    var ra2 = []
    for (var i = 0; i < ra.length ; i++ ) {
      var item = eYo.Model.statistics.getItem(i)
      if (item && item.type === type) {
        ra2.append(i)
      }
    }
    return ra2
  } else {
    return ra
  }
}

